var dagtok_ssb = jQuery.noConflict(); //dagtok ssb: social slide bar

dagtok_ssb(document).ready( function(dagtok_ssb) {
	
	var onScreen = false;
	var updateInt = vars.updateInterval;
	var menu = '<div id="dagtok_slidebar_title"><a class="social_sprite">Facebook</a></div><nav id="kiibal_slidebar"><ul class="animated"><li><a href="#"><span class="social_sprite social_networks"></span></a><ul class="clearfix">';
	vars.display_delicious	 == 'true' ? menu += '<li><a href="#" class="switch tooltip1" data-socialnetwork="Delicious"><span class="social_sprite delicious"></span></a></li>' : null;
	vars.display_deviantart	 == 'true' ? menu += '<li><a href="#" class="switch tooltip1" data-socialnetwork="Deviantart"><span class="social_sprite deviantart"></span></a></li>' : null;
	vars.display_dribbble	 == 'true' ? menu += '<li><a href="#" class="switch tooltip1" data-socialnetwork="Dribbble"><span class="social_sprite dribbble"></span></a></li>' : null;
	vars.display_flickr		 == 'true' ? menu += '<li><a href="#" class="switch tooltip1" data-socialnetwork="Flickr"><span class="social_sprite flickr"></span></a></li>' : null;    
	vars.display_foursquare	 == 'true' ? menu += '<li><a href="#" class="switch tooltip1" data-socialnetwork="Foursquare"><span class="social_sprite foursquare"></span></a></li>' : null;    
	vars.display_facebook	 == 'true' ? menu += '<li><a href="#" class="switch tooltip1" data-socialnetwork="Facebook"><span class="social_sprite facebook"></span></a></li>' : null;
	vars.display_googleplus  == 'true' ? menu += '<li><a href="#" class="switch tooltip1" data-socialnetwork="GooglePlus"><span class="social_sprite googlePlus"></span></a></li>' : null;
	vars.display_instagram   == 'true' ? menu += '<li><a href="#" class="switch tooltip1" data-socialnetwork="Instagram"><span class="social_sprite instagram"></span></a></li>' : null;
	vars.display_pinterest	 == 'true' ? menu += '<li><a href="#" class="switch tooltip1" data-socialnetwork="Pinterest"><span class="social_sprite pinterest"></span></a></li>' : null;
	vars.display_soundcloud  == 'true' ? menu += '<li><a href="#" class="switch tooltip1" data-socialnetwork="Soundcloud"><span class="social_sprite soundcloud"></span></a></li>' : null;
	vars.display_stumbleupon == 'true' ? menu += '<li><a href="#" class="switch tooltip1" data-socialnetwork="Stumbleupon"><span class="social_sprite stumbleupon"></span></a></li>' : null;
	vars.display_tumblr      == 'true' ? menu += '<li><a href="#" class="switch tooltip1" data-socialnetwork="Tumblr"><span class="social_sprite tumblr"></span></a></li>' : null;
	vars.display_twitter     == 'true' ? menu += '<li><a href="#" class="switch tooltip1" data-socialnetwork="Twitter"><span class="social_sprite twitter"></span></a></li>' : null;
	vars.display_vimeo       == 'true' ? menu += '<li><a href="#" class="switch tooltip1" data-socialnetwork="Vimeo"><span class="social_sprite vimeo"></span></a></li>' : null;
	vars.display_vine        == 'true' ? menu += '<li><a href="#" class="switch tooltip1" data-socialnetwork="Vine"><span class="social_sprite vine"></span></a></li>' : null;
	vars.display_youtube     == 'true' ? menu += '<li><a href="#" class="switch tooltip1" data-socialnetwork="Youtube"><span class="social_sprite youtube"></span></a></li>' : null;

	menu += '</ul></li></ul></nav><div id="lights"></div><div id="panel"></div>';
	
	menu.length > 265 ? dagtok_ssb('body').prepend(menu) : null;

	/*Animation Effect*/
	if (vars.updateInterval > 0) {
		
		window.setInterval(function (){
		dagtok_ssb("ul.animated").addClass("kbl-gira");
		}, (vars.updateInterval*1000));
		
		window.setInterval(function (){
			dagtok_ssb("ul.animated").removeClass("kbl-gira");
		}, ((vars.updateInterval*1000)+1000) );

		dagtok_ssb("ul.animated").mouseover(function(){

			dagtok_ssb("ul.animated").removeClass("animated");

			window.setTimeout(function(){
				dagtok_ssb('ul.kbl-gira').addClass("animated");
			}, 10000);

		});

	};
	
	switch(vars.position){
		case 'Top':
			dagtok_ssb('nav#kiibal_slidebar > ul').css('top','0');
		break;

		case 'Middle':
			dagtok_ssb('nav#kiibal_slidebar > ul').css('top','42%');
		break;		
	}

	dagtok_ssb('nav#kiibal_slidebar ul li a').css('background-color',vars.bcolor);
	dagtok_ssb('nav#kiibal_slidebar ul li ul li a').css('background-color','#FFF');
	dagtok_ssb("#panel").height(window.innerHeight-40);
	
	dagtok_ssb(".switch,#lights,#dagtok_slidebar_title").click(function() {	
		
		if (onScreen) {
			
			onScreen = false;
		 	dagtok_ssb("#panel").animate({'left': '-300'},'easeOutSine');
		 	dagtok_ssb('#dagtok_slidebar_title').fadeOut(250,function(){
		 		dagtok_ssb('nav#kiibal_slidebar > ul').fadeIn('slow');
		 	});
		 	dagtok_ssb("body").animate({'margin-left': '0'},'easeOutSine');
		 	dagtok_ssb('#lights,html,body').removeAttr('style');
		 		 	
		} else {

			onScreen = true;
			dagtok_ssb('html,body').css('overflow','hidden');
			dagtok_ssb('html,body').css('margin','0px');
			dagtok_ssb('html,body').css('padding','0px');
			dagtok_ssb("#panel").animate({'left': '0'},'easeOutSine');
			dagtok_ssb("body").animate({'margin-left': '300'},'easeOutSine');
			dagtok_ssb('#lights').css('width','100%');
			dagtok_ssb('#lights').css('height','10000px');
			dagtok_ssb('#lights').css('background-color','red');
			dagtok_ssb('#lights').css('position','absolute');
			dagtok_ssb('#lights').css('z-index','1');
			dagtok_ssb('#lights').fadeTo("fast", 0.6);
			dagtok_ssb('nav#kiibal_slidebar > ul').fadeOut('fast');
			dagtok_ssb('#dagtok_slidebar_title').fadeIn('slow');

			alert(dagtok_ssb(this).attr('data-socialnetwork'));
			var social_network = dagtok_ssb(this).attr('data-socialnetwork');
			
			switch(social_network){
				case 'Delicious':
					dagtok_ssb_get_feed_data(social_network,'#000');
				break;
				
				case 'Deviantart':
					dagtok_ssb_get_feed_data(social_network,'#475c4d');
				break;

				case 'Dribbble':
					dagtok_ssb_get_feed_data(social_network,'#000');
				break;

				case 'Facebook':
					dagtok_ssb_get_feed_data(social_network,'rgb(75, 103, 161)');
				break;
				
				case 'Flickr':
					dagtok_ssb_get_feed_data(social_network,'#000');
				break;

				case 'Foursquare':
					dagtok_ssb_get_feed_data(social_network,'#000');
				break;
				
				case 'GooglePlus':
					dagtok_ssb_get_feed_data(social_network,'rgb(243,243,243)');
				break;

				case 'Instagram':
					dagtok_ssb_get_feed_data(social_network,'rgb(95,121,149)');
				break;

				case 'Pinterest':
					dagtok_ssb_get_feed_data(social_network,'#000');
				break;

				case 'Soundcloud':
					dagtok_ssb_get_feed_data(social_network,'#000');
				break;

				case 'Stumbleupon':
					dagtok_ssb_get_feed_data(social_network,'#000');
				break;

				case 'Twitter':
					dagtok_ssb_get_feed_data(social_network,'#4099FF');
				break;
				
				case 'Tumblr':
					dagtok_ssb_get_feed_data(social_network,'#0D4B8F');
				break;

				case 'Vimeo':
					dagtok_ssb_get_feed_data(social_network,'rgb(44,198,237)');
				break;

				case 'Vine':
					dagtok_ssb_get_feed_data(social_network,'rgb(44,198,237)');
				break;

				case 'Youtube':
					dagtok_ssb_get_feed_data(social_network, 'rgb(243,243,243)');
				break;
			}
		}
		
	});

	function dagtok_ssb_get_feed_data(social_network, background_color){
		
		var social_network = social_network.toLowerCase();

		dagtok_ssb('a.social_sprite').removeClass().addClass('social_sprite '+social_network+'_logo');
		dagtok_ssb.get(vars.plugin_dir+'feeds/'+social_network+'.php?feed=html', 'Orale',function(data) {
			dagtok_ssb('#panel').html(data);
			dagtok_ssb(".nano").nanoScroller();
			dagtok_ssb(".socialslidebar_element").colorbox({rel:'socialslidebar_element', transition:"fade"});
		},'html').done(function() {
			dagtok_ssb('#dagtok_slidebar_title').css('background-color',background_color);
		});
	}
});